  false,\n\t\"url\": null,\n\t\"notes\": \"This Data Release contains data from the
  USGS field activity 2014-607-FA, a survey of the Oregon Outer Continental Shelf
  (OCS) Floating Wind Farm Site in 2014. The bathymetry raster was generated from
  bathymetry data collected by U.S. Geological Survey (USGS) during the period from
  August 20 to September 1, 2014 using a Reson 7111 multibeam echosounder. The mapping
  mission collected bathymetry data from about 163 m to 566 m depths on the Oregon
  outer continental shelf. The acquisition was funded by the U.S. Bureau of Ocean
  Energy Management. Contours were generated using the ESRI Contour tool in spatial
  analysit. The contour interval is 10 meters.\",\n\t\"license_title\": null,\n\t\"extras\":
